    {
        NavigationManager.NavigateTo($"/prueba/{id}");
    }

    void UpdatePlant(int id)
    {
        plantToEdit = PlantService.plants.Find(p => p.Id == id);
    }

    void DeletePlant(int id)
        {
        PlantService.DeletePlant(id);
        }

